import './winCalendar.css';
// googleCalendarApiKey: 'AIzaSyCNuPc8INoIhejkZ0ZpBgqxMMubNbs7Twc'
// googleCalendarId: 'c_6ac1b95b43f0bc6b7729121b7f5eb6af644b44192b24c7cd2a648282e9d5df0d@group.calendar.google.com'
import { Calendar } from '@fullcalendar/core'

function winCalendar() {
    return (

        document.addEventListener('DOMContentLoaded', function() {
          const calendarEl = document.getElementById('calendar')
          const calendar = new Calendar(calendarEl, {
            initialView: 'dayGridMonth'
          })
          calendar.render()
        })
    );
}

export default winCalendar
